import React, { useState } from 'react';
import { LogEntry } from '../types';
import { 
  CheckCircle, 
  XCircle, 
  Info, 
  ArrowRightLeft, 
  TrendingUp,
  Clock,
  Filter,
  Search
} from 'lucide-react';

interface LogsPanelProps {
  logs: LogEntry[];
}

const iconMap: { [key: string]: React.ReactNode } = {
  success: <CheckCircle className="w-5 h-5 text-green-400" />,
  error: <XCircle className="w-5 h-5 text-red-400" />,
  info: <Info className="w-5 h-5 text-blue-400" />,
  opportunity: <TrendingUp className="w-5 h-5 text-yellow-400" />,
};

const bgColorMap: { [key: string]: string } = {
  success: 'bg-green-500/10 border-green-500/20',
  error: 'bg-red-500/10 border-red-500/20',
  info: 'bg-blue-500/10 border-blue-500/20',
  opportunity: 'bg-yellow-500/10 border-yellow-500/20',
};

const LogsPanel: React.FC<LogsPanelProps> = ({ logs }) => {
  const [filter, setFilter] = useState<string>('all');
  const [search, setSearch] = useState<string>('');

  const filteredLogs = logs.filter(log => {
    const matchesFilter = filter === 'all' || log.type === filter;
    const matchesSearch = search === '' || 
      log.message.toLowerCase().includes(search.toLowerCase()) ||
      (log.details && JSON.stringify(log.details).toLowerCase().includes(search.toLowerCase()));
    return matchesFilter && matchesSearch;
  });

  return (
    <div className="h-[calc(100vh-16rem)] overflow-hidden flex flex-col rounded-lg border border-gray-700 bg-gray-800/50">
      <div className="p-4 bg-gray-700/30 border-b border-gray-700 space-y-3">
        <div className="flex items-center justify-between">
          <h2 className="text-lg font-bold flex items-center space-x-2">
            <Clock className="w-5 h-5 text-blue-400" />
            <span>Activity Logs</span>
          </h2>
          <div className="flex items-center space-x-2">
            <select
              value={filter}
              onChange={(e) => setFilter(e.target.value)}
              className="bg-gray-700/50 border border-gray-600 rounded-md px-3 py-1 text-sm focus:outline-none focus:ring-2 focus:ring-blue-500"
            >
              <option value="all">All Types</option>
              <option value="success">Success</option>
              <option value="error">Errors</option>
              <option value="info">Info</option>
              <option value="opportunity">Opportunities</option>
            </select>
            <Filter className="w-5 h-5 text-gray-400" />
          </div>
        </div>

        <div className="relative">
          <input
            type="text"
            placeholder="Search logs..."
            value={search}
            onChange={(e) => setSearch(e.target.value)}
            className="w-full bg-gray-700/50 border border-gray-600 rounded-md pl-10 pr-4 py-2 text-sm focus:outline-none focus:ring-2 focus:ring-blue-500"
          />
          <Search className="w-4 h-4 text-gray-400 absolute left-3 top-1/2 transform -translate-y-1/2" />
        </div>
      </div>

      <div className="flex-1 overflow-y-auto custom-scrollbar">
        <div className="space-y-2 p-4">
          {filteredLogs.map((log, index) => (
            <div
              key={log.timestamp + index}
              className={`
                relative overflow-hidden rounded-lg border backdrop-blur-sm
                ${bgColorMap[log.type] || 'bg-gray-700/30 border-gray-600'}
                p-4 transition-all hover:border-gray-500
              `}
            >
              <div className="flex items-start space-x-3">
                <div className="flex-shrink-0 mt-1">
                  {iconMap[log.type] || <Info className="w-5 h-5 text-gray-400" />}
                </div>

                <div className="flex-1 min-w-0">
                  <p className="text-sm text-white font-medium">
                    {log.message}
                  </p>

                  {log.details && (
                    <div className="mt-2">
                      <div className="text-xs text-gray-400 font-mono bg-black/20 rounded-md p-2 overflow-x-auto">
                        {JSON.stringify(log.details, null, 2)}
                      </div>
                    </div>
                  )}

                  <div className="mt-2 flex items-center space-x-2 text-xs text-gray-400">
                    <Clock className="w-3 h-3" />
                    <time dateTime={new Date(log.timestamp).toISOString()}>
                      {new Date(log.timestamp).toLocaleTimeString()}
                    </time>
                  </div>
                </div>
              </div>
            </div>
          ))}
        </div>
      </div>

      <div className="p-3 border-t border-gray-700 bg-gray-800/50">
        <p className="text-sm text-gray-400">
          Showing {filteredLogs.length} of {logs.length} logs
        </p>
      </div>
    </div>
  );
};

export default LogsPanel;
